--
-- Bẫy `post_votes`
--
DELIMITER $$
CREATE TRIGGER `post_vote_trigger` AFTER UPDATE ON `post_votes` FOR EACH ROW BEGIN
    -- Case 1: If the vote is switched to 'upvote' from any other vote
    IF NEW.vote_type = 'upvote' AND OLD.vote_type != 'upvote' THEN
        -- Increase the upvote count on the post
        UPDATE posts
        SET upvotes = upvotes + 1
        WHERE id = NEW.post_id;
        
        -- If the previous vote was 'downvote', decrease the downvote count
        IF OLD.vote_type = 'downvote' THEN
            UPDATE posts
            SET downvotes = downvotes - 1
            WHERE id = NEW.post_id;
        END IF;

    -- Case 2: If the vote is switched to 'downvote' from any other vote
    ELSEIF NEW.vote_type = 'downvote' AND OLD.vote_type != 'downvote' THEN
        -- Increase the downvote count on the post
        UPDATE posts
        SET downvotes = downvotes + 1
        WHERE id = NEW.post_id;
        
        -- If the previous vote was 'upvote', decrease the upvote count
        IF OLD.vote_type = 'upvote' THEN
            UPDATE posts
            SET upvotes = upvotes - 1
            WHERE id = NEW.post_id;
        END IF;
    END IF;

    -- Case 3: If a vote is removed (i.e., changed to NULL)
    IF NEW.vote_type IS NULL THEN
        IF OLD.vote_type = 'upvote' THEN
            UPDATE posts
            SET upvotes = upvotes - 1
            WHERE id = OLD.post_id;
        ELSEIF OLD.vote_type = 'downvote' THEN
            UPDATE posts
            SET downvotes = downvotes - 1
            WHERE id = OLD.post_id;
        END IF;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `post_vote_trigger_first` AFTER INSERT ON `post_votes` FOR EACH ROW BEGIN
    -- Case 1: When a vote is inserted (first time voting on a post)
    -- If the user upvotes for the first time
    IF NEW.vote_type = 'upvote' THEN
        UPDATE posts
        SET upvotes = upvotes + 1
        WHERE id = NEW.post_id;
    END IF;

    -- If the user downvotes for the first time
    IF NEW.vote_type = 'downvote' THEN
        UPDATE posts
        SET downvotes = downvotes + 1
        WHERE id = NEW.post_id;
    END IF;
END
$$
DELIMITER ;

